import React from "react";
import { StyleSheet, Image } from "react-native";

//components
import ScreenHeader from "../components/ScreenHeader";
import Screen from "../components/Screen";
import ButtonMain from "../components/ButtonMain";

// assets
import speaq_logo from "../assets/speaq_logo.png";

function StartScreen({ navigation }) {
	return (
		<Screen style={styles.screen}>
			<ScreenHeader
				navLeft={() => navigation.navigate("OptionsReset")}
				navLeftIcon={require("../assets/buttons/options_icon_light.png")}
				showRightButton={false}
				showTitle={false}
				style={styles.header}
			/>
			<Image source={speaq_logo} style={styles.logo} />
			<ButtonMain
				style={styles.button}
				title="Start"
				onPress={() => navigation.navigate("Profile")}
			/>
		</Screen>
	);
}

const styles = StyleSheet.create({
	button: {},
	header: { position: "absolute", top: 0 },
	logo: { marginBottom: 100 },
	screen: {
		// justifyContent: "center",
		// alignItems: "center",
		flex: 1,
		width: "100%",
		height: "100%",
	},
});

export default StartScreen;
